-- Sales Order Items


-- The item data was randomly generated, so we need to walk through each sales order and calculate the total from the items:

update sales_orders set total = (select sum(quantity * price) from sales_order_items where sales_order_id = sales_orders.sales_order_id group by sales_order_id);

-- Null out mock transaction credit card and filled info when the sales order doesn't have any items:

update sales_orders set card_number = null, card_expires = null, card_authorized = null, filled = null where total is null;

